import React, { Component } from 'react';
import './Profil.css'

class MyProfil extends Component {
    render () {
        return (
            <div className="PageProfil" style={{height: '100vh'}}>

                <div style={{height: '10%', width:'50%', backgroundColor:'red', margin:'auto', marginTop:'0'}}>
                    <ul style={{display:'flex', flexDirection:'row', justifyContent:'space-between'}}>
                        <li style={{width:'200px', textAlign:'center', backgroundColor:'blue', }}>Mes informations</li>
                        <li style={{width:'200px', textAlign:'center', backgroundColor:'blue'}}>Mes commandes</li>
                        <li style={{width:'200px', textAlign:'center', backgroundColor:'blue'}}>Ma Liste</li>
                    </ul>
                </div>
            </div>
        );
    };
};

export default MyProfil;
